import React from 'react';
import { Card, Flex, Typography } from 'antd';

const cardStyle = {
  maxWidth: 1034,
  width: '100%',
  margin: '0 auto',
  padding: 0,
};

const imgStyle = {
  display: 'block',
  width: 410,
  height: 525,
  marginRight: 186,
};

const DetailBox = () => (
  <Card style={cardStyle} bodyStyle={{ padding: 0 }}>
    <Flex justify="space-between">
      <img
        alt="avatar"
        src="/media/gunssak.png"
        style={imgStyle}
      />
      <Flex
        vertical
        align="flex-end"
        justify="flex-start"
      >
        <Typography.Title level={3}>군싹</Typography.Title>
        <Typography.Paragraph>
          <strong>Meaning:</strong> 군침이 싹 도네(돈다) 라는 뜻
        </Typography.Paragraph>
        <Typography.Paragraph>
          <strong>Using Example1:</strong> 군침이 싹 도는 조합인데? 맛있겠다!
        </Typography.Paragraph>
        <Typography.Paragraph>
          <strong>Using Example2:</strong> 이거 완전 군싹이네!
        </Typography.Paragraph>
      </Flex>
    </Flex>
  </Card>
);

export default DetailBox;
